    true,nt"url": null,nt"notes": "<p>The Transporter Classification Database
    details a comprehensive classification system for membrane transport proteins known
    as the Transporter Classification (TC) system. The TC system is analogous to the
    Enzyme Commission (EC) system for classification of enzymes, except that it incorporates
    both functional and phylogenetic information. Descriptions, TC numbers, and examples
    of over 600 families of transport proteins are provided.</p>n",nt"license_title":
